import React from 'react';
import {useState} from 'react';
import { setFlagsFromString } from 'v8';
import { FeedbackInterface } from '../data/FeedbackData';
import Card from './shared/Card';

export interface FeedbackItemModel {
    rating: number,
    text: string,
}

function FeedbackItem(props : FeedbackInterface) {
   // const [fedback, setFeedback] = useState<FeedbackInterface>({id: 0, rating: 6, text: 'this is an example of a feedback item'});
    
  return (
    <div className='card'>
        <Card>
              <div className="num-display">{props.rating}</div>
              <div className="text-display">{props.text}</div>
        </Card>
        
    </div>
  )
}

export default FeedbackItem
